const Table = ({ item }) => {
  const {
    selling_quantity,
    selling_amount,
    insert_date,
    currency,
    buying_price,
    buying_quantity,
    buying_amount,
  } = item;
  return (
    <div style={{ display: "flex" }}>
      <p style={{ flex: 1.42, marginLeft: 5 }}>{buying_price}</p>
      <p style={{ flex: 1.42, marginLeft: 5 }}>{buying_quantity}</p>
      <p style={{ flex: 1.42, marginLeft: 5 }}>{buying_amount}</p>
      <p style={{ flex: 1.42, marginLeft: 5 }}>{selling_amount}</p>
      <p style={{ flex: 1.42, marginLeft: 5 }}>{selling_quantity}</p>
      <p style={{ flex: 1.42, marginLeft: 5 }}>{currency}</p>
      <p style={{ flex: 1.42, marginLeft: 5 }}>{insert_date}</p>
    </div>
  );
};

export default Table;
